import React, { Component } from 'react'
import { Input, Button, Card, Form } from 'antd'
import 'antd/dist/antd.css'

class Comp_regit extends Component {

    render() {
        return (
            <div>
                <Card>
                    <Form layout="inline">
                        <Form.Item label={"E-mail"}>
                            <Input />
                        </Form.Item>
                    </Form>

                </Card>
            </div>
        )
    }
}
export default Comp_regit
